  return (
    <div className="orders-container">
      <h1 className="orders-container">My Orders</h1>
      <br /><br /><br />
        <h3 className="orders-container">No cars bought.</h3>
        <br /><br /><br /><br /><br />
      </div>
  );
};

export default Orders;
